import { Facebook, Instagram, Pinterest, Twitter } from "@material-ui/icons";
import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
`;
const Left = styled.div`
  flex: 1;
`;

const Logo = styled.h1`

`;

const Center = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;

const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>STORE.</Logo>
        <Desc>
          There are amny variations of passahed of Lorem Ipsum available, but
          the majority have suffered alteration in some form, by injected
          humore, or randomised words which don't look even slightly believable
        </Desc>
        <SocialContainer>
            <SocialIcon>
                <Facebook />
            </SocialIcon>
            <SocialIcon>
                <Twitter />
            </SocialIcon>
            <SocialIcon>
                <Instagram />
            </SocialIcon>
            <SocialIcon>
                <Pinterest />
            </SocialIcon>
        </SocialContainer>
      </Left>
      <Center></Center>
      <Right></Right>
    </Container>
  );
};

export default Footer;
